First, navigate to a directory in your file system where you would like to store the project. From there, let's issue our first orbit command: $ orbit new gates A directory called "gates" should now exist and look like the following tree structure: gates/
├─ .orbitignore
└─ Orbit.toml Let's create our first design unit for describing a NAND gate. Feel free to copy the following code into a file called "nand_gate.vhd" that exists in our project directory "/gates". Filename: nand_gate.vhd library ieee;
use ieee.std_logic_1164.all; entity nand_gate is port( a, b : in std_logic; x : out std_logic );
end entity; architecture rtl of nand_gate is
begin x <= a nand b; end architecture;

