It seems we left out some logic gates when we last worked on the gates project, so let's implement them now. Navigate to the directory in your file system where you currently store the gates project. For the rest of this tutorial, we will be working relative to the project directory "/gates" that currently stores the gates project. Let's implement the OR gate while restricting our design to only NAND gates like before. $ orbit get nand_gate --signals --instance library work; signal a : std_logic;
signal b : std_logic;
signal x : std_logic; uX : entity work.nand_gate port map( a => a, b => b, x => x ); An OR gate can be constructed using 3 NAND gates. Let's copy/paste our NAND gate instances into our new file "or_gate.vhd". Filename: or_gate.vhd library ieee;
use ieee.std_logic_1164.all; library work; entity or_gate is port( a, b : in std_logic; y : out std_logic );
end entity; architecture rtl of or_gate is signal x1, x2 : std_logic; begin -- 1st layer: This gate negates the first input 'a'. u1 : entity work.nand_gate port map( a => a, b => a, x => x1 ); -- 1st layer: This gate negates the second input 'b'. u2 : entity work.nand_gate port map( a => b, b => b, x => x2 ); -- 2nd layer: This gate produces the final output ('a' OR 'b'). u3 : entity work.nand_gate port map( a => x1, b => x2, x => y ); end architecture; Showing the list of possible design units for the current project should now include the OR gate entity. $ orbit view --units and_gate entity public
nand_gate entity public or_gate entity public

