Within the context of VHDL, let's consider a symbol to be the identifier of a primary design unit . A primary design unit is a VHDL construct that exists at the global namespace. There are four primary design units: entity package configuration context Note: VHDL does support the concept of libraries , which can add 1 level of nested scope to a primary design unit, but for this example we will assume the primary design units are defined within the same library/scope. In the following code, the symbol and_gate corresponds to an entity. Filename: lab1/and_gate.vhd entity and_gate is port( a, b : in bit; c : out bit );
end entity; Remember that this identifier could appear again at the same namespace level as this exsiting entity in a different VHDL file. Now imagine you are integrating VHDL code from various existing ips. As you instantiate entities within larger entities, you realize there exists another entity named and_gate further down in the hierarchy, but this one has a different behavior and port interface than the previously defined and_gate circuit from the "lab1/" directory. Filename: lab3/and_gate.vhd entity and_gate is port( a, b : in bit_vector(3 downto 0); c : out bit_vector(3 downto 0) );
end entity; Since the current ip requires both code segments, then traditionally your EDA tool would complain to you and be unable to resolve which and_gate to be used where. It then falls on the developer to rename one of the entities where it is defined and everywhere it is referenced, which introduces additional overhead in time and possibilities for errors. This problem is solved with DST.
